DROP TABLE IF EXISTS `la_address`;
create table la_address
(
    id           int(11) unsigned auto_increment
        primary key,
    code         varchar(50)  default '' not null comment '行政代码',
    name         varchar(255) default '' not null comment '名称',
    parent_id    int                     not null comment '父id',
    first_letter varchar(10)  default '' not null comment '首字母',
    level        int                     not null comment '城市等级 0省 1市 2县区'
)
    comment '省市区表' charset = utf8;

